            /></Col>
        <Col> <img
              src="./images/del.gif"
              width={200}
              height={150}
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            /></Col>
            <Col>
            </Col>
      </Row>
      </Container>
      </div>
    </div>
  )
}

export default Menu
